// SPDX-License-Identifier: MIT

pragma solidity ^0.8.20;

import "openzeppelin-contracts-upgradeable/access/OwnableUpgradeable.sol";
import "openzeppelin/security/ReentrancyGuard.sol";
import "./ILiquidityPool.sol";

/**
 * @title Liqudity provider contract for rewards staking contract
 * @author https://anmol-dhiman.netlify.app/
 * @notice Provide NRK tokens only to verified address
 */
contract LiquidityPool is OwnableUpgradeable, ReentrancyGuard, ILiquidityPool {
    event ContractVerified(address contractAddress, uint32 timeStamp);
    event AccessedFunds(
        address contractAddress,
        string action,
        uint32 timeStamp
    );
    event AmountMigrated(uint256 amount, address newAddress, uint32 timeStamp);
    event OwnerAccessFunds(uint256 amount, uint32 timeStamp);

    /**
     * @notice mapping for verified contract which can be accessed by owner only
     */
    mapping(address => bool) public verifiedContract;

    modifier isVerified() {
        require(verifiedContract[msg.sender], "contract is not verified");
        _;
    }

    /**
     * @dev Proxy initializer function sets new owner other than admin
     * @param _owner The owner of this contract
     */
    function initialize(address _owner) external payable initializer {
        __Ownable_init();
        transferOwnership(_owner);
    }

    /**
     * @dev verficy the contract for access rewards
     * @notice this function can only accessed by owner
     * @param _contract is the contract address which can access NRK tokens
     */
    function verifyContract(address _contract) external onlyOwner {
        require(_contract != address(0), "invalid contract address");
        verifiedContract[_contract] = true;
        emit ContractVerified(_contract, uint32(block.timestamp));
    }

    /**
     * @dev verified contract can access NRK tokens with this function only
     * @param _amount the amount of NRK tokens required by contract
     * @param _action the purpose of NRK token
     * @notice only verified contracts by owner can access this function
     * @notice this function is non reentrant
     */
    function accessFunds(
        uint256 _amount,
        string memory _action
    ) external isVerified nonReentrant {
        address _contract = msg.sender;
        require(address(this).balance >= _amount, "No NRK tokens in pool");

        (bool success, ) = _contract.call{value: _amount}("");
        require(success, "failed to send NRK tokens");
        emit AccessedFunds(_contract, _action, uint32(block.timestamp));
    }

    fallback() external payable {}

    receive() external payable {}

    /**
     * @dev this function is used to migrate the NRK tokens from this contract to another EOA or contract
     * @param amount the amount of NRK tokens needed to migrate
     * @param newAddress the address on which NRK tokens should be sent
     * @notice this functions can only be called by owner
     * @notice this function is non reentrant
     */
    function migration(
        uint256 amount,
        address newAddress
    ) external nonReentrant onlyOwner {
        require(
            address(this).balance >= amount,
            "Contract insufficient balance"
        );
        require(amount > 0, "invalid amount");
        require(newAddress != address(0), "invalid address");
        emit AmountMigrated(amount, newAddress, uint32(block.timestamp));
        (bool success, ) = newAddress.call{value: amount}("");
        require(success, "Unable to send value or recipient may have reverted");
    }

    /**
     * @dev extract NRK tokens from this contract
     * @param _amount Specific amount of NRK token needed to be removed from this contract
     * @notice the contract owner can access this function
     * @notice this function is non reentrant
     */
    function extractFunds(uint256 _amount) external onlyOwner nonReentrant {
        require(
            address(this).balance >= _amount,
            "Contract insufficient balance"
        );
        require(_amount > 0, "invalid amount");
        (bool success, ) = msg.sender.call{value: _amount}("");
        require(success, "Unable to send value or recipient may have reverted");
        emit OwnerAccessFunds(_amount, uint32(block.timestamp));
    }
}

contracts/StakingContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "openzeppelin-contracts-upgradeable/access/OwnableUpgradeable.sol";
import "openzeppelin/security/ReentrancyGuard.sol";
import "openzeppelin/utils/math/SafeMath.sol";
import "./ILiquidityPool.sol";

/**
 * @title Stake NRK tokens and earn rewards
 * @author https://anmol-dhiman.netlify.app/
 * @notice Dynamic Staking, APY and Compounding frequency
 */
contract StakingContract is OwnableUpgradeable, ReentrancyGuard {
    using SafeMath for uint256; // Using SafeMath for safe arithmetic operations

    // Flag to pause staking
    bool public pause;

    // Annual Percentage Yield in divid of 100
    // uint16 public apy;

    // minimum nrk token to be staked by user
    uint256 public minimumStake;

    uint256 public frequency;

    // this is the old struct block
    struct Stake {
        uint256 amount; // Amount of tokens staked
        uint32 startTime; // Timestamp when staking occurred
        uint256 rewards; // Accumulated rewards for the stake
    }

    struct APY {
        uint16 value;
        uint32 changeTime;
    }

    struct Slot {
        uint256 amount;
        uint256 rewards;
        uint32 startTime;
        uint256 id;
    }

    struct SlotStake {
        uint256 counter;
        // using 0 base indexing to store the staking slots
        mapping(uint256 => Slot) slotStake;
    }

    // Maps users to their stakes
    // mapping(address => Stake) public stakes;
    mapping(address => SlotStake) public stakes;

    APY[] public apy;

    ILiquidityPool public liquidityPool;

    event Staked(
        address indexed user,
        uint256 amount,
        uint32 stakeTime,
        uint256 slotId
    );
    event ReStaked(
        address indexed user,
        uint256 amount,
        uint32 stakeTime,
        uint256 slotId,
        uint256 rewardsLeft
    );

    event Unstaked(
        address indexed user,
        uint256 amount,
        uint32 unstakeTime,
        uint256 slotid,
        uint256 rewards
    );
    event UnstakedTokens(
        address indexed user,
        uint256 amount,
        uint32 unstakeTime,
        uint256 _slotId,
        uint256 rewardsLeft
    );
    event UnstakedAllTokens(
        address indexed user,
        uint256 totalAmount,
        uint256 rewards,
        uint32 unstakeTime
    );
    event RewardClaimed(
        address indexed user,
        uint256 totalReward,
        uint32 timeOfClaim,
        uint256 slotId,
        uint256 rewardsLeft
    );

    event AllRewardClaimed(
        address indexed user,
        uint256 totalReward,
        uint32 timeOfClaim
    );
    event AmountMigrated(
        uint256 amount,
        address newAddress,
        uint32 migrationTime
    );
    event RestakedAll(address user, uint256 restakedAmount, uint32 timeStamp);

    event MinimumStakeUpdated(uint256 minimumStake, uint32 timeStamp);
    event FrequencyUpdated(uint256 frequency, uint32 timeStamp);
    event ApyUpdated(uint256 apy, uint32 timeStamp);
    event LiquidityPoolUpdated(address newPool, uint32 timeStamp);

    /**
     * @dev Proxy initializer function sets new owner other than admin
     * @param _apy  = 18
     * @param _owner The owner of this contract
     * @param _minimumStake = 100000000000000000000
     * @param _frequency = 31536000
     */
    function initialize(
        uint16 _apy,
        uint256 _minimumStake,
        uint256 _frequency,
        address _liquidityPool,
        address _owner
    ) external initializer {
        apy.push(APY(_apy, uint32(block.timestamp)));
        minimumStake = _minimumStake;
        frequency = _frequency;
        liquidityPool = ILiquidityPool(_liquidityPool);
        __Ownable_init();
        transferOwnership(_owner);
    }

    fallback() external payable {}

    receive() external payable {}

    /**
     * @dev Stake tokens into the contract.
     * @notice Native NRK token more or equal to minimum value should be provided by the user
     */
    function stake() external payable {
        require(
            msg.value >= minimumStake,
            "Amount must be greater than minimum value NRK Tokens"
        );
        require(!pause, "Please wait until the staking is unpaused");

        address user = msg.sender;

        stakes[user].slotStake[stakes[user].counter].amount = stakes[user]
            .slotStake[stakes[user].counter]
            .amount
            .add(msg.value);
        stakes[user].slotStake[stakes[user].counter].startTime = uint32(
            block.timestamp
        );
        stakes[user].slotStake[stakes[user].counter].id = stakes[user].counter;

        stakes[user].counter++;
        emit Staked(
            user,
            msg.value,
            uint32(block.timestamp),
            stakes[user].counter - 1
        );
    }

    /**
     * @dev Unstake a specific amount of tokens from a specific slot
     * @param _amount The amount of tokens to be unstaked.
     * @param _slotId the id of slot from which token should be unstaked
     * @notice Unstaked tokens and rewards will be transferred to the user's address
     * @notice This is a nonReentrant function
     */
    function unstake(uint256 _amount, uint256 _slotId) public nonReentrant {
        require(!pause, "Please wait until the staking is unpaused");
        require(_amount != 0, "invalid unstake amount specified");
        address user = msg.sender;
        require(
            stakes[user].slotStake[_slotId].amount >= _amount,
            "Insufficient staked amount"
        );

        uint256 currentReward = calculateRewards(stakes[user], _slotId);
        uint256 remainingStake = stakes[user].slotStake[_slotId].amount.sub(
            _amount
        );

        stakes[user].slotStake[_slotId].amount = remainingStake;
        stakes[user].slotStake[_slotId].startTime = uint32(block.timestamp);
        stakes[user].slotStake[_slotId].rewards = 0;

        liquidityPool.accessFunds(currentReward, "UNSTAKE");

        require(
            address(this).balance >= _amount + currentReward,
            "Contract insufficient balance"
        );
        emit Unstaked(
            user,
            _amount,
            uint32(block.timestamp),
            _slotId,
            currentReward
        );
        (bool success, ) = user.call{value: _amount + currentReward}("");
        require(success, "Unable to send value or recipient may have reverted");
    }

    /**
     * @dev Unstake all the token of user
     * @notice Unstaked all tokens and total rewards will be transferred to the user's address.
     * @notice This is a nonReentrant function
     */
    function unstakeAll() external nonReentrant {
        require(!pause, "Please wait until the staking is unpaused");

        address user = msg.sender;

        uint256 rewards = getTotalRewards();
        uint256 stakedAmount = getUserTotalStakes();

        for (uint256 i = 0; i < stakes[user].counter; i++) {
            delete stakes[user].slotStake[i];
        }
        stakes[user].counter = 0;
        liquidityPool.accessFunds(rewards, "UNSTAKE");

        require(
            address(this).balance >= stakedAmount + rewards,
            "Contract insufficient balance"
        );
        emit UnstakedAllTokens(
            user,
            stakedAmount,
            rewards,
            uint32(block.timestamp)
        );
        (bool success, ) = user.call{value: stakedAmount + rewards}("");
        require(success, "Failed to send rewards and staked amount");
    }

    /**
     * @dev Unstake a specific amount of tokens
     * @param amount The amount of token user want to unstake
     * @notice Unstake specific amount of token and transfer unstaked tokens and rewards of those tokens to user
     * @notice this is a nonReentrant function
     */
    function unstake(uint256 amount) external nonReentrant {
        require(!pause, "Please wait until the staking is unpaused");
        address user = msg.sender;

        require(
            amount <= getUserTotalStakes(),
            "invalid unstaking amount specified"
        );
        SlotStake storage position = stakes[user];

        uint256 i = 0;
        uint256 totalRewards = 0;

        for (i = 0; i < position.counter; i++) {
            uint256 _amount = position.slotStake[i].amount;

            if (_amount == 0) {
                continue;
            }

            uint256 rewards = calculateRewards(position, i);
            totalRewards = totalRewards.add(rewards);

            position.slotStake[i].startTime = uint32(block.timestamp);

            if (_amount > amount) {
                position.slotStake[i].amount = _amount.sub(amount);
                break;
            } else {
                delete position.slotStake[i];
                amount = amount.sub(_amount);
            }
        }
        liquidityPool.accessFunds(totalRewards, "UNSTAKE");

        require(
            address(this).balance >= amount + totalRewards,
            "Contract insufficient balance"
        );

        // use , amount -> token + rewards, timestamp, last slot, total rewards
        emit UnstakedTokens(
            user,
            amount,
            uint32(block.timestamp),
            i,
            stakes[msg.sender].slotStake[i].amount
        );
        (bool success, ) = user.call{value: amount + totalRewards}("");
        require(success, "Failed to send rewards and staked amount");
    }

    /**
     * @dev Claim a specific amount of rewards from accumulated rewards of specific slot
     * @param _rewardAmount The amount of rewards to be claimed.
     * @param _slotId The slot id from where rewards should be claimed
     * @notice Claimed rewards will be transferred to the user's address.
     * @notice This is a nonReentrant function
     */
    function claimRewards(
        uint256 _rewardAmount,
        uint256 _slotId
    ) external nonReentrant {
        require(!pause, "Please wait until the staking is unpaused");

        address user = msg.sender;

        require(_rewardAmount > 0, "invalid amount");

        stakes[user].slotStake[_slotId].rewards = stakes[user]
            .slotStake[_slotId]
            .rewards
            .add(calculateRewards(stakes[user], _slotId));

        require(
            stakes[user].slotStake[_slotId].rewards >= _rewardAmount,
            "Insufficient rewards to claim"
        );

        stakes[user].slotStake[_slotId].rewards = stakes[user]
            .slotStake[_slotId]
            .rewards
            .sub(_rewardAmount);
        stakes[user].slotStake[_slotId].startTime = uint32(block.timestamp);

        liquidityPool.accessFunds(_rewardAmount, "CLAIM REWARDS");

        require(
            address(this).balance >= _rewardAmount,
            "Contract insufficient balance"
        );
        emit RewardClaimed(
            user,
            _rewardAmount,
            uint32(block.timestamp),
            _slotId,
            stakes[user].slotStake[_slotId].rewards
        );
        (bool success, ) = user.call{value: _rewardAmount}("");
        require(success, "Unable to send value or recipient may have reverted");
    }

    /**
     * @dev Claim all rewards from all the slots
     * @notice Transfer total rewards of user from accumulated rewards of each slot
     * @notice This is a nonReentrant function
     */

    function claimAllRewards() external nonReentrant {
        require(!pause, "Please wait until the staking is unpaused");
        uint256 length = stakes[msg.sender].counter;
        address user = msg.sender;
        uint256 _rewardAmount = getTotalRewards();
        liquidityPool.accessFunds(_rewardAmount, "CLAIM ALL REWARDS");

        require(
            address(this).balance > _rewardAmount,
            "Contract insufficient balance"
        );
        for (uint256 i = 0; i < length; i++) {
            stakes[user].slotStake[i].rewards = 0;
            stakes[user].slotStake[i].startTime = uint32(block.timestamp);
        }
        emit AllRewardClaimed(user, _rewardAmount, uint32(block.timestamp));
        (bool success, ) = user.call{value: _rewardAmount}("");
        require(success, "Unable to send value or recipient may have reverted");
    }

    /**
     * @dev Calculate the accumulated rewards for a specific stake in a specific slot.
     * @param _stake The specific user stake data for which to calculate rewards.
     * @param _slotId The slot for which to calculate rewards
     * @return The calculated rewards for the given stake of specific slot .
     **/
    function calculateRewards(
        SlotStake storage _stake,
        uint256 _slotId
    ) internal view returns (uint256) {
        uint256 index = 0;

        uint256 rewards = 0;

        uint32 startTime = _stake.slotStake[_slotId].startTime;

        uint256 initialAmount = _stake.slotStake[_slotId].amount;

        uint256 length = apy.length;

        // example apy changing format
        // 18 -> 16 -> 14 -> 20(current)
        // here we have to find at which point user staked his assets

        if (length > 1) {
            for (uint256 i = 0; i < length; i++) {
                if (startTime <= apy[i].changeTime) {
                    index = i;
                    break;
                }
            }
            // 18 -> 16 -> (staking point of user)
            // this means that user staked after apy updated
            if (index == 0) {
                // calculate reward with current apy value
                return
                    initialAmount.mul(apy[length - 1].value).mul(
                        block.timestamp - startTime
                    ) / (10000 * frequency);
            }
            // 18-> (staking point of user) -> 16
            // this means user staked before apy updation
            else {
                for (uint256 i = index; i < length; i++) {
                    uint256 _value = initialAmount.mul(apy[i - 1].value).mul(
                        apy[i].changeTime - startTime
                    ) / (10000 * frequency);
                    // rewards.add(_value);
                    rewards += _value;
                    startTime = apy[i].changeTime;
                }
                rewards +=
                    initialAmount.mul(apy[length - 1].value).mul(
                        block.timestamp - startTime
                    ) /
                    (10000 * frequency);

                return rewards;
            }
        }
        // single apy value in array
        else {
            return
                initialAmount.mul(apy[0].value).mul(
                    block.timestamp - startTime
                ) / (10000 * frequency);
        }
    }

    /**
     * @dev Restake a specific amount of rewards of specific slot and update stake.
     * @param _amount The amount of rewards to be restaked.
     * @param _slotId The slod it of which rewards to be restaked.
     * @notice This is a nonReentrant function
     */
    function restake(uint256 _amount, uint256 _slotId) external nonReentrant {
        require(!pause, "Please wait until the staking is unpaused");
        address user = msg.sender;

        stakes[user].slotStake[_slotId].rewards = stakes[user]
            .slotStake[_slotId]
            .rewards
            .add(calculateRewards(stakes[user], _slotId)); // Use SafeMath
        require(
            stakes[user].slotStake[_slotId].rewards >= _amount,
            "Insufficient rewards to restake"
        );

        uint256 totalStake = stakes[user].slotStake[_slotId].amount.add(
            _amount
        );

        stakes[user].slotStake[_slotId].amount = totalStake;
        stakes[user].slotStake[_slotId].startTime = uint32(block.timestamp);
        stakes[user].slotStake[_slotId].rewards = stakes[user]
            .slotStake[_slotId]
            .rewards
            .sub(_amount);

        emit ReStaked(
            user,
            _amount,
            uint32(block.timestamp),
            _slotId,
            stakes[user].slotStake[_slotId].rewards
        );
    }

    /**
     * @dev Restake a specific amount of rewards.
     * @param amount The amount of rewards to restake
     * @notice This is a nonReentrant function
     */

    function restake(uint256 amount) external nonReentrant {
        require(!pause, "Please wait until the staking is unpaused");
        address user = msg.sender;

        uint256 totalRewards = getTotalRewards();
        require(
            amount <= totalRewards,
            "invalid amount specified for restaking"
        );
        SlotStake storage position = stakes[user];
        uint256 i = 0;
        for (i = 0; i < position.counter; i++) {
            uint256 rewardsPerSlot = position.slotStake[i].rewards.add(
                calculateRewards(stakes[user], i)
            );
            position.slotStake[i].rewards = rewardsPerSlot;
            position.slotStake[i].startTime = uint32(block.timestamp);
            // break condition where amount specified to restake is smaller than rewards in particular slot
            if (position.slotStake[i].rewards > amount) {
                position.slotStake[i].amount = position.slotStake[i].amount.add(
                    amount
                );
                position.slotStake[i].rewards = stakes[user]
                    .slotStake[i]
                    .rewards
                    .sub(amount);
                break;
            } else {
                position.slotStake[i].amount = position.slotStake[i].amount.add(
                    rewardsPerSlot
                );
                position.slotStake[i].rewards = 0;
                amount = amount.sub(rewardsPerSlot);
            }
        }

        emit ReStaked(
            user,
            amount,
            uint32(block.timestamp),
            i,
            position.slotStake[i].rewards
        );
    }

    /**
     * @dev Restake all the accumulated rewards of each slot
     * @notice this is a nonReentrant function
     */
    function restakeAll() external nonReentrant {
        require(!pause, "Please wait until the staking is unpaused");
        address user = msg.sender;

        SlotStake storage position = stakes[user];
        uint256 i = 0;
        uint256 totalAmountRestaked = 0;
        for (i = 0; i < position.counter; i++) {
            uint256 rewardsPerSlot = position.slotStake[i].rewards.add(
                calculateRewards(stakes[user], i)
            );
            totalAmountRestaked = totalAmountRestaked.add(rewardsPerSlot);
            position.slotStake[i].rewards = 0;
            position.slotStake[i].startTime = uint32(block.timestamp);
            position.slotStake[i].amount = position.slotStake[i].amount.add(
                rewardsPerSlot
            );
        }

        // TODO need to add an event here
        emit RestakedAll(user, totalAmountRestaked, uint32(block.timestamp));
    }

    /**
     * @dev Get the staked amount and start time for sender of a specific slot.
     * @param _slotId the slot id of which token amount and start time requested.
     * @return amount The amount of tokens staked.
     * @return startTime The timestamp when staking occurred.
     */
    function getUserStake(
        uint256 _slotId
    ) external view returns (uint256 amount, uint32 startTime) {
        Slot storage userStake = stakes[msg.sender].slotStake[_slotId];
        return (userStake.amount, userStake.startTime);
    }

    /**
     * @dev Get the total staked amount of sender
     **/
    function getUserTotalStakes() public view returns (uint256 amount) {
        SlotStake storage userSlotStakes = stakes[msg.sender];
        for (uint256 i = 0; i < userSlotStakes.counter; i++) {
            amount += userSlotStakes.slotStake[i].amount;
        }
    }

    /**
     * @dev Get the array of details of each slot of user
     * @return Array of detail of each slot i.e. slot id, amount staked, rewards and startTime
     */
    function getUserStakesInfo() external view returns (Slot[] memory) {
        uint256 length = stakes[msg.sender].counter;
        Slot[] memory userStakeSlots = new Slot[](length);

        for (uint256 i = 0; i < length; i++) {
            userStakeSlots[i] = stakes[msg.sender].slotStake[i];
        }
        return userStakeSlots;
    }

    /**
     * @dev Get the total accumulated rewards for sender of specific slot.
     * @param _slotId  the specific slot id of which senders rewards requested
     * @return The total amount of accumulated rewards.
     */
    function getUserRewards(uint256 _slotId) public view returns (uint256) {
        uint256 rewards = calculateRewards(stakes[msg.sender], _slotId).add(
            stakes[msg.sender].slotStake[_slotId].rewards
        ); // Use SafeMath
        return rewards;
    }

    /**
     * @dev Get the total rewards till now of sender.
     * @return total accumulated rewards of sender of each slot till now
     */
    function getTotalRewards() public view returns (uint256) {
        uint256 rewards;
        uint256 length = stakes[msg.sender].counter;
        for (uint256 i = 0; i < length; i++) {
            rewards += getUserRewards(i);
        }
        return rewards;
    }

    /**
     * @dev Get current apy
     * @return APY value
     */
    function getCurrentApy() external view returns (uint256) {
        return apy[apy.length - 1].value;
    }

    /**
     * @dev Update the staking pause status.
     * @param _pause The new staking pause status.
     * @notice This function can only be called by the contract owner.
     */
    function updateStakingPause(bool _pause) external onlyOwner {
        pause = _pause;
    }

    /**
     * @dev Set the APY (Annual Percentage Yield).
     * @param _newAPY The new APY value.
     * @notice This function can only be called by the contract owner.
     */
    function setAPY(uint16 _newAPY) external onlyOwner {
        apy.push(APY(_newAPY, uint32(block.timestamp)));
        emit ApyUpdated(_newAPY, uint32(block.timestamp));
    }

    /**
     * @dev Set the minimum NRK token
     * @param _newMinimumStake new minimum NRK stake value
     * @notice this function can only be called by the contract owner.
     */
    function setMinimumStake(uint256 _newMinimumStake) external onlyOwner {
        minimumStake = _newMinimumStake;
        emit MinimumStakeUpdated(_newMinimumStake, uint32(block.timestamp));
    }

    /**
     * @dev Set the frequency
     * @param _frequency the new frequency
     * @notice this function can only be called by the contract owner.
     */
    function setFrequency(uint256 _frequency) external onlyOwner {
        frequency = _frequency;
        emit FrequencyUpdated(_frequency, uint32(block.timestamp));
    }

    /**
     * @dev Set the liqudity pool which provides reward NRK tokens
     * @param _liquidityPool new pool address.
     * @notice this function can only be called by the contract owner.
     */
    function setLiquidityPool(address _liquidityPool) external onlyOwner {
        liquidityPool = ILiquidityPool(_liquidityPool);
        emit LiquidityPoolUpdated(_liquidityPool, uint32(block.timestamp));
    }

    /**
     * @dev Migrate funds to a new contract address.
     * @param amount The amount of funds to migrate.
     * @param newAddress The address of the new contract to receive the funds.
     * @notice This function is non-reentrant and can only be called by the contract owner.
     */
    function migration(
        uint256 amount,
        address newAddress
    ) external nonReentrant onlyOwner {
        require(
            address(this).balance >= amount,
            "Contract insufficient balance"
        );
        require(amount > 0, "invalid amount");
        require(newAddress != address(0), "invalid address");
        emit AmountMigrated(amount, newAddress, uint32(block.timestamp));
        (bool success, ) = newAddress.call{value: amount}("");
        require(success, "Unable to send value or recipient may have reverted");
    }
}

contracts/UniswapV2ERC20.sol.content:
pragma solidity ^0.8.20;

import "./interfaces/IUniswapV2ERC20.sol";
import "./libraries/SafeMath.sol";

contract UniswapV2ERC20 is IUniswapV2ERC20 {
    using SafeMath for uint;

    string public constant name = "Nordek V2";
    string public constant symbol = "NRK-LP";
    uint8 public constant decimals = 18;
    uint public totalSupply;
    mapping(address => uint) public balanceOf;
    mapping(address => mapping(address => uint)) public allowance;

    bytes32 public DOMAIN_SEPARATOR;
    // keccak256("Permit(address owner,address spender,uint256 value,uint256 nonce,uint256 deadline)");
    bytes32 public constant PERMIT_TYPEHASH =
        0x6e71edae12b1b97f4d1f60370fef10105fa2faae0126114a169c64845d6126c9;
    mapping(address => uint) public nonces;

    event Approval(address indexed owner, address indexed spender, uint value);
    event Transfer(address indexed from, address indexed to, uint value);

    constructor() {
        uint chainId;
        assembly {
            chainId := chainid()
        }
        DOMAIN_SEPARATOR = keccak256(
            abi.encode(
                keccak256(
                    "EIP712Domain(string name,string version,uint256 chainId,address verifyingContract)"
                ),
                keccak256(bytes(name)),
                keccak256(bytes("1")),
                chainId,
                address(this)
            )
        );
    }

    function _mint(address to, uint value) internal {
        totalSupply = totalSupply.add(value);
        balanceOf[to] = balanceOf[to].add(value);
        emit Transfer(address(0), to, value);
    }

    function _burn(address from, uint value) internal {
        balanceOf[from] = balanceOf[from].sub(value);
        totalSupply = totalSupply.sub(value);
        emit Transfer(from, address(0), value);
    }

    function _approve(address owner, address spender, uint value) private {
        allowance[owner][spender] = value;
        emit Approval(owner, spender, value);
    }

    function _transfer(address from, address to, uint value) private {
        balanceOf[from] = balanceOf[from].sub(value);
        balanceOf[to] = balanceOf[to].add(value);
        emit Transfer(from, to, value);
    }

    function approve(address spender, uint value) external returns (bool) {
        _approve(msg.sender, spender, value);
        return true;
    }

    function transfer(address to, uint value) external returns (bool) {
        _transfer(msg.sender, to, value);
        return true;
    }

    function transferFrom(
        address from,
        address to,
        uint value
    ) external returns (bool) {
        if (allowance[from][msg.sender] != type(uint).max) {
            allowance[from][msg.sender] = allowance[from][msg.sender].sub(
                value
            );
        }
        _transfer(from, to, value);
        return true;
    }

    function permit(
        address owner,
        address spender,
        uint value,
        uint deadline,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external {
        require(deadline >= block.timestamp, "UniswapV2: EXPIRED");
        bytes32 digest = keccak256(
            abi.encodePacked(
                "\x19\x01",
                DOMAIN_SEPARATOR,
                keccak256(
                    abi.encode(
                        PERMIT_TYPEHASH,
                        owner,
                        spender,
                        value,
                        nonces[owner]++,
                        deadline
                    )
                )
            )
        );
        address recoveredAddress = ecrecover(digest, v, r, s);
        require(
            recoveredAddress != address(0) && recoveredAddress == owner,
            "UniswapV2: INVALID_SIGNATURE"
        );
        _approve(owner, spender, value);
    }
}

contracts/UniswapV2Factory.sol.content:
pragma solidity ^0.8.20;

import "./interfaces/IUniswapV2Factory.sol";
import "./UniswapV2Pair.sol";

contract UniswapV2Factory is IUniswapV2Factory {
    address public feeTo;
    address public feeToSetter;

    mapping(address => mapping(address => address)) public getPair;
    address[] public allPairs;

    event PairCreated(
        address indexed token0,
        address indexed token1,
        address pair,
        uint
    );

    constructor(address _feeToSetter) {
        feeToSetter = _feeToSetter;
    }

    function allPairsLength() external view returns (uint) {
        return allPairs.length;
    }

    function createPair(
        address tokenA,
        address tokenB
    ) external returns (address pair) {
        require(tokenA != tokenB, "UniswapV2: IDENTICAL_ADDRESSES");
        (address token0, address token1) = tokenA < tokenB
            ? (tokenA, tokenB)
            : (tokenB, tokenA);
        require(token0 != address(0), "UniswapV2: ZERO_ADDRESS");
        require(
            getPair[token0][token1] == address(0),
            "UniswapV2: PAIR_EXISTS"
        ); // single check is sufficient
        bytes memory bytecode = type(UniswapV2Pair).creationCode;
        bytes32 salt = keccak256(abi.encodePacked(token0, token1));
        assembly {
            pair := create2(0, add(bytecode, 32), mload(bytecode), salt)
        }
        IUniswapV2Pair(pair).initialize(token0, token1);
        getPair[token0][token1] = pair;
        getPair[token1][token0] = pair; // populate mapping in the reverse direction
        allPairs.push(pair);
        emit PairCreated(token0, token1, pair, allPairs.length);
    }

    function setFeeTo(address _feeTo) external {
        require(msg.sender == feeToSetter, "UniswapV2: FORBIDDEN");
        feeTo = _feeTo;
    }

    function setFeeToSetter(address _feeToSetter) external {
        require(msg.sender == feeToSetter, "UniswapV2: FORBIDDEN");
        feeToSetter = _feeToSetter;
    }
}

contracts/UniswapV2Pair.sol.content:
pragma solidity ^0.8.20;

import "./interfaces/IUniswapV2Pair.sol";
import "./UniswapV2ERC20.sol";
import "./libraries/Math.sol";
import "./libraries/UQ112x112.sol";
import "./interfaces/IERC20.sol";
import "./interfaces/IUniswapV2Factory.sol";
import "./interfaces/IUniswapV2Callee.sol";

contract UniswapV2Pair is IUniswapV2Pair, UniswapV2ERC20 {
    using SafeMath for uint;
    using UQ112x112 for uint224;

    uint public constant MINIMUM_LIQUIDITY = 10 ** 3;
    bytes4 private constant SELECTOR =
        bytes4(keccak256(bytes("transfer(address,uint256)")));

    address public factory;
    address public token0;
    address public token1;

    uint112 private reserve0; // uses single storage slot, accessible via getReserves
    uint112 private reserve1; // uses single storage slot, accessible via getReserves
    uint32 private blockTimestampLast; // uses single storage slot, accessible via getReserves

    uint public price0CumulativeLast;
    uint public price1CumulativeLast;
    uint public kLast; // reserve0 * reserve1, as of immediately after the most recent liquidity event

    uint private unlocked = 1;
    modifier lock() {
        require(unlocked == 1, "UniswapV2: LOCKED");
        unlocked = 0;
        _;
        unlocked = 1;
    }

    function getReserves()
        public
        view
        returns (
            uint112 _reserve0,
            uint112 _reserve1,
            uint32 _blockTimestampLast
        )
    {
        _reserve0 = reserve0;
        _reserve1 = reserve1;
        _blockTimestampLast = blockTimestampLast;
    }

    function _safeTransfer(address token, address to, uint value) private {
        (bool success, bytes memory data) = token.call(
            abi.encodeWithSelector(SELECTOR, to, value)
        );
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            "UniswapV2: TRANSFER_FAILED"
        );
    }

    event Mint(address indexed sender, uint amount0, uint amount1);
    event Burn(
        address indexed sender,
        uint amount0,
        uint amount1,
        address indexed to
    );
    event Swap(
        address indexed sender,
        uint amount0In,
        uint amount1In,
        uint amount0Out,
        uint amount1Out,
        address indexed to
    );
    event Sync(uint112 reserve0, uint112 reserve1);

    constructor() {
        factory = msg.sender;
    }

    // called once by the factory at time of deployment
    function initialize(address _token0, address _token1) external {
        require(msg.sender == factory, "UniswapV2: FORBIDDEN"); // sufficient check
        token0 = _token0;
        token1 = _token1;
    }

    // update reserves and, on the first call per block, price accumulators
    function _update(
        uint balance0,
        uint balance1,
        uint112 _reserve0,
        uint112 _reserve1
    ) private {
        require(
            balance0 <= type(uint112).max && balance1 <= type(uint112).max,
            "UniswapV2: OVERFLOW"
        );
        uint32 blockTimestamp = uint32(block.timestamp % 2 ** 32);
        uint32 timeElapsed = blockTimestamp - blockTimestampLast; // overflow is desired
        if (timeElapsed > 0 && _reserve0 != 0 && _reserve1 != 0) {
            // * never overflows, and + overflow is desired
            price0CumulativeLast +=
                uint(UQ112x112.encode(_reserve1).uqdiv(_reserve0)) *
                timeElapsed;
            price1CumulativeLast +=
                uint(UQ112x112.encode(_reserve0).uqdiv(_reserve1)) *
                timeElapsed;
        }
        reserve0 = uint112(balance0);
        reserve1 = uint112(balance1);
        blockTimestampLast = blockTimestamp;
        emit Sync(reserve0, reserve1);
    }

    // if fee is on, mint liquidity equivalent to 1/6th of the growth in sqrt(k)
    function _mintFee(
        uint112 _reserve0,
        uint112 _reserve1
    ) private returns (bool feeOn) {
        address feeTo = IUniswapV2Factory(factory).feeTo();
        feeOn = feeTo != address(0);
        uint _kLast = kLast; // gas savings
        if (feeOn) {
            if (_kLast != 0) {
                uint rootK = Math.sqrt(uint(_reserve0).mul(_reserve1));
                uint rootKLast = Math.sqrt(_kLast);
                if (rootK > rootKLast) {
                    uint numerator = totalSupply.mul(rootK.sub(rootKLast));
                    uint denominator = rootK.mul(5).add(rootKLast);
                    uint liquidity = numerator / denominator;
                    if (liquidity > 0) _mint(feeTo, liquidity);
                }
            }
        } else if (_kLast != 0) {
            kLast = 0;
        }
    }

    // this low-level function should be called from a contract which performs important safety checks
    function mint(address to) external lock returns (uint liquidity) {
        (uint112 _reserve0, uint112 _reserve1, ) = getReserves(); // gas savings
        uint balance0 = IERC20(token0).balanceOf(address(this));
        uint balance1 = IERC20(token1).balanceOf(address(this));
        uint amount0 = balance0.sub(_reserve0);
        uint amount1 = balance1.sub(_reserve1);

        bool feeOn = _mintFee(_reserve0, _reserve1);
        uint _totalSupply = totalSupply; // gas savings, must be defined here since totalSupply can update in _mintFee
        if (_totalSupply == 0) {
            liquidity = Math.sqrt(amount0.mul(amount1)).sub(MINIMUM_LIQUIDITY);
            _mint(address(0), MINIMUM_LIQUIDITY); // permanently lock the first MINIMUM_LIQUIDITY tokens
        } else {
            liquidity = Math.min(
                amount0.mul(_totalSupply) / _reserve0,
                amount1.mul(_totalSupply) / _reserve1
            );
        }
        require(liquidity > 0, "UniswapV2: INSUFFICIENT_LIQUIDITY_MINTED");
        _mint(to, liquidity);

        _update(balance0, balance1, _reserve0, _reserve1);
        if (feeOn) kLast = uint(reserve0).mul(reserve1); // reserve0 and reserve1 are up-to-date
        emit Mint(msg.sender, amount0, amount1);
    }

    // this low-level function should be called from a contract which performs important safety checks
    function burn(
        address to
    ) external lock returns (uint amount0, uint amount1) {
        (uint112 _reserve0, uint112 _reserve1, ) = getReserves(); // gas savings
        address _token0 = token0; // gas savings
        address _token1 = token1; // gas savings
        uint balance0 = IERC20(_token0).balanceOf(address(this));
        uint balance1 = IERC20(_token1).balanceOf(address(this));
        uint liquidity = balanceOf[address(this)];

        bool feeOn = _mintFee(_reserve0, _reserve1);
        uint _totalSupply = totalSupply; // gas savings, must be defined here since totalSupply can update in _mintFee
        amount0 = liquidity.mul(balance0) / _totalSupply; // using balances ensures pro-rata distribution
        amount1 = liquidity.mul(balance1) / _totalSupply; // using balances ensures pro-rata distribution
        require(
            amount0 > 0 && amount1 > 0,
            "UniswapV2: INSUFFICIENT_LIQUIDITY_BURNED"
        );
        _burn(address(this), liquidity);
        _safeTransfer(_token0, to, amount0);
        _safeTransfer(_token1, to, amount1);
        balance0 = IERC20(_token0).balanceOf(address(this));
        balance1 = IERC20(_token1).balanceOf(address(this));

        _update(balance0, balance1, _reserve0, _reserve1);
        if (feeOn) kLast = uint(reserve0).mul(reserve1); // reserve0 and reserve1 are up-to-date
        emit Burn(msg.sender, amount0, amount1, to);
    }

    // this low-level function should be called from a contract which performs important safety checks
    function swap(
        uint amount0Out,
        uint amount1Out,
        address to,
        bytes calldata data
    ) external lock {
        require(
            amount0Out > 0 || amount1Out > 0,
            "UniswapV2: INSUFFICIENT_OUTPUT_AMOUNT"
        );
        (uint112 _reserve0, uint112 _reserve1, ) = getReserves(); // gas savings
        require(
            amount0Out < _reserve0 && amount1Out < _reserve1,
            "UniswapV2: INSUFFICIENT_LIQUIDITY"
        );

        uint balance0;
        uint balance1;
        {
            // scope for _token{0,1}, avoids stack too deep errors
            address _token0 = token0;
            address _token1 = token1;
            require(to != _token0 && to != _token1, "UniswapV2: INVALID_TO");
            if (amount0Out > 0) _safeTransfer(_token0, to, amount0Out); // optimistically transfer tokens
            if (amount1Out > 0) _safeTransfer(_token1, to, amount1Out); // optimistically transfer tokens
            if (data.length > 0)
                IUniswapV2Callee(to).uniswapV2Call(
                    msg.sender,
                    amount0Out,
                    amount1Out,
                    data
                );
            balance0 = IERC20(_token0).balanceOf(address(this));
            balance1 = IERC20(_token1).balanceOf(address(this));
        }
        uint amount0In = balance0 > _reserve0 - amount0Out
            ? balance0 - (_reserve0 - amount0Out)
            : 0;
        uint amount1In = balance1 > _reserve1 - amount1Out
            ? balance1 - (_reserve1 - amount1Out)
            : 0;
        require(
            amount0In > 0 || amount1In > 0,
            "UniswapV2: INSUFFICIENT_INPUT_AMOUNT"
        );
        {
            // scope for reserve{0,1}Adjusted, avoids stack too deep errors
            uint balance0Adjusted = balance0.mul(1000).sub(amount0In.mul(3));
            uint balance1Adjusted = balance1.mul(1000).sub(amount1In.mul(3));
            require(
                balance0Adjusted.mul(balance1Adjusted) >=
                    uint(_reserve0).mul(_reserve1).mul(1000 ** 2),
                "UniswapV2: K"
            );
        }

        _update(balance0, balance1, _reserve0, _reserve1);
        emit Swap(msg.sender, amount0In, amount1In, amount0Out, amount1Out, to);
    }

    // force balances to match reserves
    function skim(address to) external lock {
        address _token0 = token0; // gas savings
        address _token1 = token1; // gas savings
        _safeTransfer(
            _token0,
            to,
            IERC20(_token0).balanceOf(address(this)).sub(reserve0)
        );
        _safeTransfer(
            _token1,
            to,
            IERC20(_token1).balanceOf(address(this)).sub(reserve1)
        );
    }

    // force reserves to match balances
    function sync() external lock {
        _update(
            IERC20(token0).balanceOf(address(this)),
            IERC20(token1).balanceOf(address(this)),
            reserve0,
            reserve1
        );
    }
}

contracts/UniswapV2Router02.sol.content:
pragma solidity ^0.8.20;

import "./interfaces/IUniswapV2Factory.sol";
import "./libraries/TransferHelper.sol";
import "./interfaces/IUniswapV2Router02.sol";
import "./libraries/UniswapV2Library.sol";
import "./libraries/SafeMath.sol";
import "./interfaces/IERC20.sol";
import "./interfaces/IWETH.sol";

contract UniswapV2Router02 is IUniswapV2Router02 {
    using SafeMath for uint;

    address public immutable factory;
    address public immutable WETH;

    modifier ensure(uint deadline) {
        require(deadline >= block.timestamp, "UniswapV2Router: EXPIRED");
        _;
    }

    constructor(address _factory, address _WETH) {
        factory = _factory;
        WETH = _WETH;
    }

    receive() external payable {
        assert(msg.sender == WETH); // only accept ETH via fallback from the WETH contract
    }

    // **** ADD LIQUIDITY ****
    function _addLiquidity(
        address tokenA,
        address tokenB,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin
    ) internal virtual returns (uint amountA, uint amountB) {
        // create the pair if it doesn't exist yet
        if (IUniswapV2Factory(factory).getPair(tokenA, tokenB) == address(0)) {
            IUniswapV2Factory(factory).createPair(tokenA, tokenB);
        }
        (uint reserveA, uint reserveB) = UniswapV2Library.getReserves(
            factory,
            tokenA,
            tokenB
        );
        if (reserveA == 0 && reserveB == 0) {
            (amountA, amountB) = (amountADesired, amountBDesired);
        } else {
            uint amountBOptimal = UniswapV2Library.quote(
                amountADesired,
                reserveA,
                reserveB
            );
            if (amountBOptimal <= amountBDesired) {
                require(
                    amountBOptimal >= amountBMin,
                    "UniswapV2Router: INSUFFICIENT_B_AMOUNT"
                );
                (amountA, amountB) = (amountADesired, amountBOptimal);
            } else {
                uint amountAOptimal = UniswapV2Library.quote(
                    amountBDesired,
                    reserveB,
                    reserveA
                );
                assert(amountAOptimal <= amountADesired);
                require(
                    amountAOptimal >= amountAMin,
                    "UniswapV2Router: INSUFFICIENT_A_AMOUNT"
                );
                (amountA, amountB) = (amountAOptimal, amountBDesired);
            }
        }
    }

    function addLiquidity(
        address tokenA,
        address tokenB,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    )
        external
        virtual
        override
        ensure(deadline)
        returns (uint amountA, uint amountB, uint liquidity)
    {
        (amountA, amountB) = _addLiquidity(
            tokenA,
            tokenB,
            amountADesired,
            amountBDesired,
            amountAMin,
            amountBMin
        );
        address pair = UniswapV2Library.pairFor(factory, tokenA, tokenB);
        TransferHelper.safeTransferFrom(tokenA, msg.sender, pair, amountA);
        TransferHelper.safeTransferFrom(tokenB, msg.sender, pair, amountB);
        liquidity = IUniswapV2Pair(pair).mint(to);
    }

    function addLiquidityETH(
        address token,
        uint amountTokenDesired,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    )
        external
        payable
        virtual
        override
        ensure(deadline)
        returns (uint amountToken, uint amountETH, uint liquidity)
    {
        (amountToken, amountETH) = _addLiquidity(
            token,
            WETH,
            amountTokenDesired,
            msg.value,
            amountTokenMin,
            amountETHMin
        );
        address pair = UniswapV2Library.pairFor(factory, token, WETH);
        TransferHelper.safeTransferFrom(token, msg.sender, pair, amountToken);
        IWETH(WETH).deposit{value: amountETH}();
        assert(IWETH(WETH).transfer(pair, amountETH));
        liquidity = IUniswapV2Pair(pair).mint(to);
        // refund dust eth, if any
        if (msg.value > amountETH)
            TransferHelper.safeTransferETH(msg.sender, msg.value - amountETH);
    }

    // **** REMOVE LIQUIDITY ****
    function removeLiquidity(
        address tokenA,
        address tokenB,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    )
        public
        virtual
        override
        ensure(deadline)
        returns (uint amountA, uint amountB)
    {
        address pair = UniswapV2Library.pairFor(factory, tokenA, tokenB);
        IUniswapV2Pair(pair).transferFrom(msg.sender, pair, liquidity); // send liquidity to pair
        (uint amount0, uint amount1) = IUniswapV2Pair(pair).burn(to);
        (address token0, ) = UniswapV2Library.sortTokens(tokenA, tokenB);
        (amountA, amountB) = tokenA == token0
            ? (amount0, amount1)
            : (amount1, amount0);
        require(
            amountA >= amountAMin,
            "UniswapV2Router: INSUFFICIENT_A_AMOUNT"
        );
        require(
            amountB >= amountBMin,
            "UniswapV2Router: INSUFFICIENT_B_AMOUNT"
        );
    }

    function removeLiquidityETH(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    )
        public
        virtual
        override
        ensure(deadline)
        returns (uint amountToken, uint amountETH)
    {
        (amountToken, amountETH) = removeLiquidity(
            token,
            WETH,
            liquidity,
            amountTokenMin,
            amountETHMin,
            address(this),
            deadline
        );
        TransferHelper.safeTransfer(token, to, amountToken);
        IWETH(WETH).withdraw(amountETH);
        TransferHelper.safeTransferETH(to, amountETH);
    }

    function removeLiquidityWithPermit(
        address tokenA,
        address tokenB,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline,
        bool approveMax,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external virtual override returns (uint amountA, uint amountB) {
        address pair = UniswapV2Library.pairFor(factory, tokenA, tokenB);
        uint value = approveMax ? type(uint256).max : liquidity;
        IUniswapV2Pair(pair).permit(
            msg.sender,
            address(this),
            value,
            deadline,
            v,
            r,
            s
        );
        (amountA, amountB) = removeLiquidity(
            tokenA,
            tokenB,
            liquidity,
            amountAMin,
            amountBMin,
            to,
            deadline
        );
    }

    function removeLiquidityETHWithPermit(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline,
        bool approveMax,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external virtual override returns (uint amountToken, uint amountETH) {
        address pair = UniswapV2Library.pairFor(factory, token, WETH);
        uint value = approveMax ? type(uint256).max : liquidity;
        IUniswapV2Pair(pair).permit(
            msg.sender,
            address(this),
            value,
            deadline,
            v,
            r,
            s
        );
        (amountToken, amountETH) = removeLiquidityETH(
            token,
            liquidity,
            amountTokenMin,
            amountETHMin,
            to,
            deadline
        );
    }

    // **** REMOVE LIQUIDITY (supporting fee-on-transfer tokens) ****
    function removeLiquidityETHSupportingFeeOnTransferTokens(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) public virtual override ensure(deadline) returns (uint amountETH) {
        (, amountETH) = removeLiquidity(
            token,
            WETH,
            liquidity,
            amountTokenMin,
            amountETHMin,
            address(this),
            deadline
        );
        TransferHelper.safeTransfer(
            token,
            to,
            IERC20(token).balanceOf(address(this))
        );
        IWETH(WETH).withdraw(amountETH);
        TransferHelper.safeTransferETH(to, amountETH);
    }

    function removeLiquidityETHWithPermitSupportingFeeOnTransferTokens(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline,
        bool approveMax,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external virtual override returns (uint amountETH) {
        address pair = UniswapV2Library.pairFor(factory, token, WETH);
        uint value = approveMax ? type(uint256).max : liquidity;
        IUniswapV2Pair(pair).permit(
            msg.sender,
            address(this),
            value,
            deadline,
            v,
            r,
            s
        );
        amountETH = removeLiquidityETHSupportingFeeOnTransferTokens(
            token,
            liquidity,
            amountTokenMin,
            amountETHMin,
            to,
            deadline
        );
    }

    // **** SWAP ****
    // requires the initial amount to have already been sent to the first pair
    function _swap(
        uint[] memory amounts,
        address[] memory path,
        address _to
    ) internal virtual {
        for (uint i; i < path.length - 1; i++) {
            (address input, address output) = (path[i], path[i + 1]);
            (address token0, ) = UniswapV2Library.sortTokens(input, output);
            uint amountOut = amounts[i + 1];
            (uint amount0Out, uint amount1Out) = input == token0
                ? (uint(0), amountOut)
                : (amountOut, uint(0));
            address to = i < path.length - 2
                ? UniswapV2Library.pairFor(factory, output, path[i + 2])
                : _to;
            IUniswapV2Pair(UniswapV2Library.pairFor(factory, input, output))
                .swap(amount0Out, amount1Out, to, new bytes(0));
        }
    }

    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    )
        external
        virtual
        override
        ensure(deadline)
        returns (uint[] memory amounts)
    {
        amounts = UniswapV2Library.getAmountsOut(factory, amountIn, path);
        require(
            amounts[amounts.length - 1] >= amountOutMin,
            "UniswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT"
        );
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            UniswapV2Library.pairFor(factory, path[0], path[1]),
            amounts[0]
        );
        _swap(amounts, path, to);
    }

    function swapTokensForExactTokens(
        uint amountOut,
        uint amountInMax,
        address[] calldata path,
        address to,
        uint deadline
    )
        external
        virtual
        override
        ensure(deadline)
        returns (uint[] memory amounts)
    {
        amounts = UniswapV2Library.getAmountsIn(factory, amountOut, path);
        require(
            amounts[0] <= amountInMax,
            "UniswapV2Router: EXCESSIVE_INPUT_AMOUNT"
        );
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            UniswapV2Library.pairFor(factory, path[0], path[1]),
            amounts[0]
        );
        _swap(amounts, path, to);
    }

    function swapExactETHForTokens(
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    )
        external
        payable
        virtual
        override
        ensure(deadline)
        returns (uint[] memory amounts)
    {
        require(path[0] == WETH, "UniswapV2Router: INVALID_PATH");
        amounts = UniswapV2Library.getAmountsOut(factory, msg.value, path);
        require(
            amounts[amounts.length - 1] >= amountOutMin,
            "UniswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT"
        );
        IWETH(WETH).deposit{value: amounts[0]}();
        assert(
            IWETH(WETH).transfer(
                UniswapV2Library.pairFor(factory, path[0], path[1]),
                amounts[0]
            )
        );
        _swap(amounts, path, to);
    }

    function swapTokensForExactETH(
        uint amountOut,
        uint amountInMax,
        address[] calldata path,
        address to,
        uint deadline
    )
        external
        virtual
        override
        ensure(deadline)
        returns (uint[] memory amounts)
    {
        require(path[path.length - 1] == WETH, "UniswapV2Router: INVALID_PATH");
        amounts = UniswapV2Library.getAmountsIn(factory, amountOut, path);
        require(
            amounts[0] <= amountInMax,
            "UniswapV2Router: EXCESSIVE_INPUT_AMOUNT"
        );
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            UniswapV2Library.pairFor(factory, path[0], path[1]),
            amounts[0]
        );
        _swap(amounts, path, address(this));
        IWETH(WETH).withdraw(amounts[amounts.length - 1]);
        TransferHelper.safeTransferETH(to, amounts[amounts.length - 1]);
    }

    function swapExactTokensForETH(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    )
        external
        virtual
        override
        ensure(deadline)
        returns (uint[] memory amounts)
    {
        require(path[path.length - 1] == WETH, "UniswapV2Router: INVALID_PATH");
        amounts = UniswapV2Library.getAmountsOut(factory, amountIn, path);
        require(
            amounts[amounts.length - 1] >= amountOutMin,
            "UniswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT"
        );
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            UniswapV2Library.pairFor(factory, path[0], path[1]),
            amounts[0]
        );
        _swap(amounts, path, address(this));
        IWETH(WETH).withdraw(amounts[amounts.length - 1]);
        TransferHelper.safeTransferETH(to, amounts[amounts.length - 1]);
    }

    function swapETHForExactTokens(
        uint amountOut,
        address[] calldata path,
        address to,
        uint deadline
    )
        external
        payable
        virtual
        override
        ensure(deadline)
        returns (uint[] memory amounts)
    {
        require(path[0] == WETH, "UniswapV2Router: INVALID_PATH");
        amounts = UniswapV2Library.getAmountsIn(factory, amountOut, path);
        require(
            amounts[0] <= msg.value,
            "UniswapV2Router: EXCESSIVE_INPUT_AMOUNT"
        );
        IWETH(WETH).deposit{value: amounts[0]}();
        assert(
            IWETH(WETH).transfer(
                UniswapV2Library.pairFor(factory, path[0], path[1]),
                amounts[0]
            )
        );
        _swap(amounts, path, to);
        // refund dust eth, if any
        if (msg.value > amounts[0])
            TransferHelper.safeTransferETH(msg.sender, msg.value - amounts[0]);
    }

    // **** SWAP (supporting fee-on-transfer tokens) ****
    // requires the initial amount to have already been sent to the first pair
    function _swapSupportingFeeOnTransferTokens(
        address[] memory path,
        address _to
    ) internal virtual {
        for (uint i; i < path.length - 1; i++) {
            (address input, address output) = (path[i], path[i + 1]);
            (address token0, ) = UniswapV2Library.sortTokens(input, output);
            IUniswapV2Pair pair = IUniswapV2Pair(
                UniswapV2Library.pairFor(factory, input, output)
            );
            uint amountInput;
            uint amountOutput;
            {
                // scope to avoid stack too deep errors
                (uint reserve0, uint reserve1, ) = pair.getReserves();
                (uint reserveInput, uint reserveOutput) = input == token0
                    ? (reserve0, reserve1)
                    : (reserve1, reserve0);
                amountInput = IERC20(input).balanceOf(address(pair)).sub(
                    reserveInput
                );
                amountOutput = UniswapV2Library.getAmountOut(
                    amountInput,
                    reserveInput,
                    reserveOutput
                );
            }
            (uint amount0Out, uint amount1Out) = input == token0
                ? (uint(0), amountOutput)
                : (amountOutput, uint(0));
            address to = i < path.length - 2
                ? UniswapV2Library.pairFor(factory, output, path[i + 2])
                : _to;
            pair.swap(amount0Out, amount1Out, to, new bytes(0));
        }
    }

    function swapExactTokensForTokensSupportingFeeOnTransferTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external virtual override ensure(deadline) {
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            UniswapV2Library.pairFor(factory, path[0], path[1]),
            amountIn
        );
        uint balanceBefore = IERC20(path[path.length - 1]).balanceOf(to);
        _swapSupportingFeeOnTransferTokens(path, to);
        require(
            IERC20(path[path.length - 1]).balanceOf(to).sub(balanceBefore) >=
                amountOutMin,
            "UniswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT"
        );
    }

    function swapExactETHForTokensSupportingFeeOnTransferTokens(
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external payable virtual override ensure(deadline) {
        require(path[0] == WETH, "UniswapV2Router: INVALID_PATH");
        uint amountIn = msg.value;
        IWETH(WETH).deposit{value: amountIn}();
        assert(
            IWETH(WETH).transfer(
                UniswapV2Library.pairFor(factory, path[0], path[1]),
                amountIn
            )
        );
        uint balanceBefore = IERC20(path[path.length - 1]).balanceOf(to);
        _swapSupportingFeeOnTransferTokens(path, to);
        require(
            IERC20(path[path.length - 1]).balanceOf(to).sub(balanceBefore) >=
                amountOutMin,
            "UniswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT"
        );
    }

    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external virtual override ensure(deadline) {
        require(path[path.length - 1] == WETH, "UniswapV2Router: INVALID_PATH");
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            UniswapV2Library.pairFor(factory, path[0], path[1]),
            amountIn
        );
        _swapSupportingFeeOnTransferTokens(path, address(this));
        uint amountOut = IERC20(WETH).balanceOf(address(this));
        require(
            amountOut >= amountOutMin,
            "UniswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT"
        );
        IWETH(WETH).withdraw(amountOut);
        TransferHelper.safeTransferETH(to, amountOut);
    }

    // **** LIBRARY FUNCTIONS ****
    function quote(
        uint amountA,
        uint reserveA,
        uint reserveB
    ) public pure virtual override returns (uint amountB) {
        return UniswapV2Library.quote(amountA, reserveA, reserveB);
    }

    function getAmountOut(
        uint amountIn,
        uint reserveIn,
        uint reserveOut
    ) public pure virtual override returns (uint amountOut) {
        return UniswapV2Library.getAmountOut(amountIn, reserveIn, reserveOut);
    }

    function getAmountIn(
        uint amountOut,
        uint reserveIn,
        uint reserveOut
    ) public pure virtual override returns (uint amountIn) {
        return UniswapV2Library.getAmountIn(amountOut, reserveIn, reserveOut);
    }

    function getAmountsOut(
        uint amountIn,
        address[] memory path
    ) public view virtual override returns (uint[] memory amounts) {
        return UniswapV2Library.getAmountsOut(factory, amountIn, path);
    }

    function getAmountsIn(
        uint amountOut,
        address[] memory path
    ) public view virtual override returns (uint[] memory amounts) {
        return UniswapV2Library.getAmountsIn(factory, amountOut, path);
    }
}

